thbrandon", "body": "@INSPIRFASH anything new and fresh in the #fashion seen that I need to know about... let me know.", "url": "https://twitter.com/talkwithbrandon/status/1094642467671035910", "date": "2019-02-10"}}, {"model": "main.thread", "pk": 14, "fields": {"tweet_id": "1094642761939251200", "username": "talkwithbrandon", "body": "@Hopsman321 I'd love to get you behind the camera to do some short-form videos as well. I'm sure you'd be great.", "url": "https://twitter.com/talkwithbrandon/status/1094642761939251200", "date": "2019-02-10"}}, {"model": "main.thread", "pk": 15, "fields": {"tweet_id": "1094642873880973312", "username": "talkwithbrandon", "body": "@StartupsBot keep sharing that great #startup information!", "url": "https://twitter.com/talkwithbrandon/status/1094642873880973312", "date": "2019-02-10"}}, {"model": "main.thread", "pk": 16, "fields": {"tweet_id": "1094690117296574464", "username": "talkwithbrandon", "body": "@SydSalesman being able to take time off from #business is just an effective way to give yourself time to recharge and rejuvenate.", "url": "https://twitter.com/talkwithbrandon/status/1094690117296574464", "date": "2019-02-10"}}, {"model": "main.thread", "pk": 17, "fields": {"tweet_id": "1094690303120936960", "username": "talkwithbrandon", "body": "@alameen_mohmmed a lot of #business success comes from empowering the people around you to take over and help out.", "url": "https://twitter.com/talkwithbrandon/status/1094690303120936960", "date": "2019-02-10"}}, {"model": "main.thread", "pk": 18, "fields": {"tweet_id": "1094690406367936513", "username": "talkwithbrandon", "body": "@EagleLadyCat trying to do everything yourself in #business gets tedious and exhausting.", "url": "https://twitter.com/talkwithbrandon/status/1094690406367936513", "date": "2019-02-10"}}, {"model": "main.thread", "pk": 19, "fields": {"tweet_id": "1094690723386089472", "username": "talkwithbrandon", "body": "@EagleLadyCat just because a bank will give you a #business loan, it doesn't mean you need to take it.", "url": "https://twitter.com/talkwithbrandon/status/1094690723386089472", "date": "2019-02-10"}}, {"model": "main.thread", "pk": 20, "fields": {"tweet_id": "1091381866400120832", "username": "Milad_Zabihi", "body": "Error 1: People love taking shortcuts when making decisions ù smart people more so than others because they believe they are better than others based on their prior accomplishments. #MultiFactorAnalysis #StartupTips #decisionmaking", "url": "https://twitter.com/Milad_Zabihi/status/1091381866400120832", "date": "2019-02-01"}}, {"model": "main.thread", "pk": 21, "fields": {"tweet_id": "1091382297985601536", "username": "Milad_Zabihi", "body": "Error 2: People place more emphasis on recent events than the event warrants, such as pouring money into bitcoin after bitcoin price sruge.\n#MultiFactorAnalysis #StartupTips #decisionmaking", "url": "https://twitter.com/Milad_Zabihi/status/1091382297985601536", "date": "2019-02-01"}}, {"model": "main.thread", "pk": 22, "fields": {"tweet_id": "1091382663364042753", "username": "Milad_Zabihi", "body": "Error 3: We also anchor our valuations to recent events. For example, If an IPO is successful, funding to startups goes up. \n #MultiFactorAnalysis #StartupTips #decisionmaking", "url": "https://twitter.com/Milad_Zabihi/status/1091382663364042753", "date": "2019-02-01"}}, {"model": "main.thread", "pk": 23, "fields": {"tweet_id": "1091382912929345539", "username": "Milad_Zabihi", "body": "Error No. 4: We value the popular view especially shared among more successful people. Case in point is YC demo days.\n#MultiFactorAnalysis #StartupTips #decisionmaking", "url": "https://twitter.com/Milad_Zabihi/status/1091382912929345539", "date": "2019-02-01"}}, {"model": "main.thread", "pk": 24, "fields": {"tweet_id": "1091383115216412672", "username": "Milad_Zabihi", "body": "Error No. 5: We think that what we have available is all thatÆs available.\n#MultiFactorAnalysis #StartupTips #decisionmaking", "url": "https://twitter.com/Milad_Zabihi/status/1091383115216412672", "date": "2019-02-01"}}, {"model": "main.thread", "pk": 25, "fields": {"tweet_id": "1091383348373610497", "username": "Milad_Zabihi", "body": 
